import React from 'react';
import doodle from "../../../image/doodle.png";
import clickable from "../../../image/clickable.png";
import saly from "../../../image/saly.png";
import {StyleSheet, css} from 'aphrodite';
import Text from "../../helpers/Text";
import Buttons from "../../helpers/Buttons";

function Price(props) {
    const style = StyleSheet.create({
        doodle: {
            top: "-10%"
        },
        absolute: {
            position: "absolute"
        },
        clickable: {
            top: "90%"
        },
        saly: {
            left: "60%",
            top: "0"
        },
        prices: {
            flex: 0.9,
            paddingTop:"10%",
            height: "200px",
            width: "24rem",
            alignItems: "center",
            justifyContent: "center"
        }
    })
    return (
        <div style={{
            flex: "1"
        }}>
            <div style={{
                position: "relative"
            }
            }>

                <div className={css(style.prices) + " col"}>
                    <Text center="center" text=" $ 252 " size="4rem" fontWeight={700}></Text>
                    <Buttons nameOfButton="Купить"></Buttons>
                </div>


                <img className={css(style.saly, style.absolute)} src={saly}/>
                <img className={css(style.doodle, style.absolute)} src={doodle}/>
                <img className={css(style.clickable, style.absolute)} src={clickable}/>

            </div>
        </div>
    );
}

export default Price;
